import React from 'react';
import HomePage from "./pages/homepage/HomePage";
import Shop from './pages/shop/Shop';

import { Switch, Route } from "react-router-dom";
import './App.css'

const App = () => {
  return (

    <div className="App">

      <Switch>

        <Route exact path="/">
          <HomePage />
        </Route>

        <Route exact path="shop/" component={Shop}>

        </Route>

      </Switch>

    </div>

  );
};

export default App;
